  \"2016-07-27T23:02:34.339429\",\n\t\"name\": \"health-and-status-of-the-pacific-walrus-population-field-investigation-report-savoonga-ala\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This report provides an account of work
  undertaken in spring of 1981 in a continuing study of the health and status of the
  North Pacific walrus population. This segment involved a monitoring of the harvest
  of walruses by residents of the village of Savoonga on St. Lawrence Island. A harvest
  monitoring program has been carried out in Savoonga in most years since 1960 and
  involved placement of an observer in the village during the height of the spring
  walrus harvest (mid-May through June) to record conditions of the hunt and collect
  specimen materials such as tusks and canine teeth from a sample of the harvested
  animals. The methods used are discussed, as well as the results. A study map and
  data forms are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
